/*Table structure for table `game` */

DROP TABLE IF EXISTS `game`;

CREATE TABLE `game` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `RefCode` varchar(6) NOT NULL COMMENT 'Ref Code',
  `GroupCode` varchar(6) NOT NULL COMMENT 'Group Code',
  `GameName` varchar(100) NOT NULL COMMENT 'Game Name',
  `GameType` int(10) NOT NULL COMMENT 'Link TO Game Type',
  `Partner1` int(10) DEFAULT NULL COMMENT 'Link TO Partner',
  `Partner2` int(10) DEFAULT NULL COMMENT 'Link TO Partner',
  `PercentShare` int(10) NOT NULL COMMENT 'PercentShare',
  `Territory` int(10) NOT NULL COMMENT 'Link to country list',
  `Publisher` varchar(100) DEFAULT NULL COMMENT 'Publisher',
  `PaymentChannel` varchar(100) DEFAULT NULL COMMENT 'Payment Channel',
  `DataSourceRemarks` varchar(100) DEFAULT NULL COMMENT 'DataSource Remarks',
  `IsActive` tinyint(1) DEFAULT '1',
  `IsDelete` tinyint(1) DEFAULT NULL COMMENT 'soft delete flag',
  `DeletedBy` int(10) DEFAULT NULL COMMENT 'activity audit trail capture',
  `DeletedOn` datetime DEFAULT NULL COMMENT 'activity audit trail capture',
  `CreatedBy` int(10) DEFAULT NULL COMMENT 'activity audit trail capture',
  `CreatedOn` datetime DEFAULT NULL COMMENT 'activity audit trail capture',
  `ModifiedBy` int(10) DEFAULT NULL COMMENT 'activity audit trail capture',
  `ModifiedOn` datetime DEFAULT NULL COMMENT 'activity audit trail capture',
  PRIMARY KEY (`id`),
  UNIQUE KEY `IndexRefCode` (`RefCode`),
  KEY `FK_Game1` (`DeletedBy`),
  KEY `FK_Game2` (`CreatedBy`),
  KEY `FK_Game3` (`ModifiedBy`),
  KEY `FK_gameType_Game` (`GameType`),
  KEY `FK_Partner_Game1` (`Partner1`),
  KEY `FK_Partner_Game2` (`Partner2`),
  KEY `FK_Country_Game` (`Territory`),
  CONSTRAINT `FK_Country_Game` FOREIGN KEY (`Territory`) REFERENCES `country` (`id`),
  CONSTRAINT `FK_Game1` FOREIGN KEY (`DeletedBy`) REFERENCES `user` (`user_id`),
  CONSTRAINT `FK_Game2` FOREIGN KEY (`CreatedBy`) REFERENCES `user` (`user_id`),
  CONSTRAINT `FK_Game3` FOREIGN KEY (`ModifiedBy`) REFERENCES `user` (`user_id`),
  CONSTRAINT `FK_Partner_Game1` FOREIGN KEY (`Partner1`) REFERENCES `partner` (`id`),
  CONSTRAINT `FK_Partner_Game2` FOREIGN KEY (`Partner2`) REFERENCES `partner` (`id`),
  CONSTRAINT `FK_gameType_Game` FOREIGN KEY (`GameType`) REFERENCES `gametype` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

